import React from "react";
import Login from "./components/Login";
import "./App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Menu, Card, Icon } from "semantic-ui-react";
import Dashboard from "./components/Dashboard";
import AssignmentDetails from "./components/assignment_details.";

function App() {
  return (
    <Router>
      <Menu icon>
        <Menu.Item>
          13 <Icon name="star outline" color="yellow" size="large" />

        </Menu.Item>
        <Menu.Item>
          13 <Icon name="graduation cap" color="yellow" size="large" />
          13 <Icon name="heart outline" color="olive" size="large" />
        </Menu.Item>
      </Menu>
      <center>
        <div style={{ maxWidth: "720px" }}>
          {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
          <Switch>
            <Route path="/login">
              <Login />
            </Route>
            <Route path="/dashboard">
              <Dashboard />
            </Route>
            <Route path="/assignment_details">
              <AssignmentDetails />
            </Route>
            <Route path="/">
              <Login />
            </Route>
          </Switch>
        </div>
      </center>
    </Router>
  );
}

export default App;
